import "./PlaceView.css";
import ReviewList from "../ReviewList/ReviewList";
import { Row, Col, Typography, Button } from "antd";
import { PlusOutlined } from "@ant-design/icons";

function PlaceView() {
  return (
    <div>
      <Row>
        <Col span={24}>
          <Button
            type="primary"
            shape="circle"
            icon={<PlusOutlined />}
            size='large'
          />
          <Title>Earls Yaletown</Title>
        </Col>
      </Row>
      <ReviewList />
    </div>
  );
}

export default PlaceView;
